import api from '../api';
import { Plant } from '../gameObjects'

// Creates a new Plant, with a uniqueID, growth initialised at 0 and a new date

export default async function createPlant(userId, event, seed) {

  let plant = new Plant(userId, event, seed)
  let id = 0

  await api.addPlant(plant).then(res => {
      plant.plantId = res.data.id
  })


  return plant
}
